import React from 'react';
import Header from '../components/Header';
import Food from '../components/Food';
import BottomFoodHTML from '../components/BottomFood';


function FoodHTML() {
  return (
    <>
      <Header />
      <Food />
      <BottomFoodHTML />
    </>
  );
}

export default FoodHTML;
